import AdminTable from '../components/AdminTable/admintable.component'
import { useUserData } from "../utils/auth.context";


const Login = () => {
   const { state } = useUserData();
   return(
      <>
        <AdminTable dataUser={state}/>
      </>
   );
}

export default Login;
